import React, { useState } from 'react';
import styled from 'styled-components';

import { InputText } from '../styles/InputOutputFields'
import { ColumnFlexWrapper, SimpleFlexWrapper, WrapAreas } from '../styles/FlexWrapper'
import { Label } from '../styles/Label'


// const Card = styled.div`
//   ${rounded}
//   ${column}
// `
const ComponentWrapper = styled.div`
    margin-bottom: 10px;
`;


const WebStiteName = (props) => (
    <ComponentWrapper>
        <Label>
            Web Site Name
        </Label>
    </ComponentWrapper>

);

const CsvGeneration = () => {
    // Declare a new state variable, which we'll call "count"
    //   const [count, setCount] = useState(0);

    return (
        <SimpleFlexWrapper top="10px">
            <WrapAreas adjust="true">
                <InputText placeholder="unit" />
                <SimpleFlexWrapper top="20px" justify="space-between">
                    <InputText placeholder="unit" />
                    <InputText placeholder="sizes" />
                    <InputText placeholder="placement" />
                </SimpleFlexWrapper>
            </WrapAreas>
        </SimpleFlexWrapper>
    );
}

export { CsvGeneration };
